import React, { useState } from 'react';
import Webcam from 'react-webcam';
import axios from 'axios';

const Ashu = () => {
  const [image, setImage] = useState(null);  // Store the captured image
  const [ingredients, setIngredients] = useState([]);
  const [probabilities, setProbabilities] = useState([]);
  const [mass, setMass] = useState(100);  // Default mass value
  const [nutritionInfo, setNutritionInfo] = useState(null);
  const [capturing, setCapturing] = useState(false);

  const webcamRef = React.useRef(null);

  // Capture image from the webcam
  const captureImage = () => {
    const imageSrc = webcamRef.current.getScreenshot();  // Get base64 image string
    setImage(imageSrc);  // Store the captured image in the state
    setCapturing(true);  // Set capturing state to true
  };

  const handleMassChange = (e) => {
    setMass(e.target.value);  // Update the mass value when the user changes it
  };

  // Handle base64 image to send to backend for ingredient prediction
  const predictIngredients = async () => {
    if (!image) {
      console.error("No image captured.");
      return;
    }

    try {
      const response = await axios.post('http://localhost:5001/predict_image', {
        image: image,  // Send the base64 image to the backend
        mass: mass     // Send the mass value along with the image
      });

      setIngredients(response.data.ingredients);
      setProbabilities(response.data.probabilities);
    } catch (error) {
      console.error("Error in ingredient prediction:", error);
    }
  };

  // Handle base64 image to send to backend for nutrition prediction
  const predictNutrition = async () => {
    if (!image) {
      console.error("No image captured.");
      return;
    }

    try {
      const response = await axios.post('http://localhost:5001/predict_portion', {
        image: image,  // Send the base64 image to the backend
        mass: mass     // Send the mass value along with the image
      });

      setNutritionInfo(response.data);
    } catch (error) {
      console.error("Error in nutrition prediction:", error);
    }
  };

  return (
    <div className="App">
      <h1>Food Nutrient Prediction</h1>

      {/* Display webcam or captured image */}
      {capturing ? (
        <>
          <img src={image} alt="Captured" />
          <div>
            <label>Mass (grams):</label>
            <input 
              type="number" 
              value={mass} 
              onChange={handleMassChange}  // Handle mass change
            />
            <button onClick={predictNutrition}>Predict Nutrition</button>
            <div>
              {nutritionInfo && (
                <div>
                  <h3>Nutrition Info:</h3>
                  <p>Protein: {nutritionInfo.protein}</p>
                  <p>Fat: {nutritionInfo.fat}</p>
                  <p>Carbs: {nutritionInfo.carbs}</p>
                  <p>Calories: {nutritionInfo.calories}</p>
                </div>
              )}
            </div>
          </div>
        </>
      ) : (
        <Webcam
          audio={false}
          ref={webcamRef}
          screenshotFormat="image/jpeg"
          width="100%"
        />
      )}

      {/* Buttons to capture image and predict */}
      <button onClick={captureImage}>Capture Image</button>
      <button onClick={predictIngredients}>Predict Ingredients</button>

      {/* Display predicted ingredients */}
      <div>
        {ingredients.length > 0 ? (
          <ul>
            {ingredients.map((ingredient, index) => (
              <li key={index}>
                {ingredient}: {probabilities[index].toFixed(2)}% {/* Display probability as percentage */}
              </li>
            ))}
          </ul>
        ) : (
          <p>No ingredients predicted yet.</p>
        )}
      </div>

      {/* Allow the user to capture another image */}
      <button onClick={() => setCapturing(false)}>Capture New Image</button>
    </div>
  );
};

export default Ashu;
